import React, { Component } from 'react'
import MCSS from 'materialize-css'
import "materialize-css/dist/css/materialize.min.css";
import image1 from "./../../../assests/images/krishi.jpg";
import image2 from "./../../../assests/images/krishi.jpg";

export class sideNav extends Component {


  componentDidMount() {
    const options = {
      inDuration: 250,
      outDuration: 200,
      draggable: true
    };

    MCSS.Sidenav.init(this.Sidenav);

    let instance = MCSS.Sidenav.getInstance(this.Sidenav);
    instance.open();
    console.log(instance.isOpen);
  }

  render() {
    return (

            // <div>
            //     <div>
            //         <p>User Name: <input type="text"></input></p>
            //         <p>Password: <input type="Pass"></input></p>
            //         <button>Login</button>
            //         <a className="waves-effect waves-light btn">button</a>
            //     </div>
            // </div>
            <>
        <ul
          ref={Sidenav => {
            this.Sidenav = Sidenav;
          }}
          id="slide-out"
          className="sidenav fixed"
        >
          <li>
            <div className="user-view">
              <div className="background">
                <img  />
              </div>
              <a href="#user">
                <img className="circle"  />
              </a>
              <a href="#name">
                <span className="white-text name">John Doe</span>
              </a>
              <a href="#email">
                <span className="white-text email">jdandturk@gmail.com</span>
              </a>
            </div>
          </li>
          <li>
            <a href="#!">
              <i className="material-icons">cloud</i>First Link With Icon
            </a>
          </li>
          <li>
            <a href="#!">Second Link</a>
          </li>
          <li>
            <div className="divider" />
          </li>
          <li>
            <a className="subheader">Subheader</a>
          </li>
          <li>
            <a className="waves-effect" href="#!">
              Third Link With Waves
            </a>
          </li>
        </ul>
        <a href="#!" data-target="slide-out" className="sidenav-trigger">
          <i className="material-icons">menu</i>
        </a>
      </>
        )
  }
}

export default sideNav
